import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';

import Badge from '@mui/material/Badge';

import MenuIcon from '@mui/icons-material/Menu';

import AccountCircle from '@mui/icons-material/AccountCircle';
import MailIcon from '@mui/icons-material/Mail';
import NotificationsIcon from '@mui/icons-material/Notifications';
import MoreIcon from '@mui/icons-material/MoreVert';
import { blue } from '@mui/material/colors';
import { TextField } from '@mui/material';
import Input from './Input';
import { Height } from '@mui/icons-material';




export default function PrimarySearchAppBar() {

  return (
    <Box >
      <AppBar sx={{ background:"#ffe7a3" }}>
        <Toolbar sx={{color:"black" ,display:'flex', justifyContent:"space-between" }}>

        <Typography
                    variant={"h4"}
                    style={{
                      margin: 4,
                      fontFamily: "Edu AU VIC WA NT Arrows ,cursive",
                      position: "relative",
                      top: "10px",
                      fontSize: "55px", 
                    }}
                  >
                    Tip /Mart
                  </Typography>

                    <Box>
                      <Input  type="search"
                    label="Search"
                    style={{ mt: 1, width: 200 ,Height :11}}

                    name="searchHome"/>

                    </Box>



          <Box sx={{ display: { xs: 'none', md: 'flex' } }}>
          <Box component={"h4"} sx={{mr:4}}>Category </Box>
          <Box component={"h4"} sx={{mr:4}}>Become Seller </Box>
          <Box component={"h4"}>Login</Box>
          <Box component={"h4"}>/SignUp</Box>
          </Box>

        </Toolbar>
      </AppBar>


    </Box>
  );
}
